!function(){var t=angular.module("produto",[]);t.controller("ProdutoController",["$scope","$http",function(t,e){t.title="Detalhes do produto",e.get("http://edsonemiliano.com.br/tricae-teste/products.json").success(function(e){t.listaProdutos=e.products}),t.formatDate=function(t){return t.replace(/-/g,"/")},t.calc=function(){var t=0;$(".price.ng-binding").each(function(){t+=parseFloat($(this).text().replace("$",""))}),t+=parseFloat($("#frete").val().replace("$","")),$(".right.last.lastrow").text("$"+parseFloat(t).toFixed(2))}}]),window.calcFrete=function(){jQuery("#frete").val("$"+["12.00","34.56","5.00","17.50"][parseInt(3*Math.random())]).trigger("change")}}();